    "2016-01-28T07:15:49.702941",nt"name": "children-and-family-health-well-being-2010-shape",nt"isopen":
    true,nt"url": null,nt"notes": "Baltimore City continues to make improving
    the health and lives of its residents a priority. In 2011, the City released the
    update of Community Health Profiles for all CSAs as well as Healthy Baltimore 2015
    Safe Homes and Families, a comprehensive health policy agenda and measures for tracking
    progress. In order to describe the health and well being of City residents, BNIA-JFI
    currently tracks thirteen adult, juvenile, and infant health indicators for Baltimore
    City and its neighborhoods. The data is provided by the Maryland Department of Health
    and Mental Hygiene, Maryland Department of the Environment, Baltimore Substance
    Abuse Systems (BSAS), the Baltimore City Health Department, and the United States
    Bureau of the Census. Where possible, data is presented at the CSA and City level.
    For several indicators, data is only available at the zip code level.",nt"license_title":
